*Defisiensi Vitamin D*
.
Defisiensi vitamin D bisa dialami oleh siapapun, termasuk bayi, anak¬≤, & orang dewasa. Meski umumnya tidak memiliki gejala yang spesifik. Ada beberapa tanda & gejala yang bisa timbul ketika tubuh kekurangan vitamin D.
.
- Pada Bayi & Anak
Bayi & anak¬≤ yang kekurangan vitamin D dapat menunjukkan beberapa gejala berikut :
1. Sesak napas
2. Kram & kejang otot
3. Pertumbuhan lebih lambat
4. Terlambat tumbuh gigi & berjalan
5. Nyeri tulang
Selain gejala¬≤ di atas, bentuk kaki yang bengkok dapat menjadi tanda anak kekurangan vitamin D. Malah terserang penyakit juga bisa menandakan anak mengalami defisiensi vitamin D, karena kekurangan vitamin ini dapat melemahkan daya tahan tubuh.
.
- Pada Orang Dewasa
Pada orang dewasa, kekurangan vitamin D biasanya ditandai dengan beberapa gejala berikut :
1. Sering mengalami nyeri otot, nyeri punggung, & nyeri tulang.
2. Tulang rapuh atau mudah patah, meskipun tidak mengalami cedera berat.
3. Mudah terserang penyakit infeksi, seperti flu.
4. Tubuh mudah lelah atau lelah berkepanjangan.
5. Suasana hati yang buruk, atau menunjukkan gejala depresi.
6. Luka yang sulit sembuh.
7. Rambut rontok.
.
Ibu hamil yang kurang asupan vitamin D berisiko mengalami sejumlah komplikasi kehamilan, seperti diabetes gestasional, preeklamsia, & kelahiran prematur, serta berisiko tinggi melahirkan secara caesar.
.
